B.yh=new A.aU("Lucros cessantes em decorr\xeancia de RC","A cobertura repara preju\xedzos ou perdas financeiras decorrentes de danos causados a terceiros em fun\xe7\xe3o dos trabalhos realizados na obra.",null)
B.yO=new A.aU("Erro de projeto","Tem o objetivo de amparar danos materiais e/ou corporais ocorridos a terceiros durante a execu\xe7\xe3o de obra ou servi\xe7o em raz\xe3o de erros de projeto.",null)
B.yL=new A.aU("Derramamento, infiltra\xe7\xe3o e/ou descarga de \xe1gua","Derramamentos, infiltra\xe7\xf5es e descargas de \xe1gua podem causar enormes preju\xedzos para os envolvidos em trabalhos de constru\xe7\xe3o civil. Sendo assim, \xe9 poss\xedvel contratar uma cobertura espec\xedfica para esse fim.",null)
B.yi=new A.aU("Objetos pessoais de empregados","Objetos pessoais de empregados sob guarda do segurado \n\n Outra cobertura que pode ser contratada em um Seguro RC Obras \xe9 a que garante amparo a preju\xedzos ocasionados a objetos pessoais de empregados que estejam sob a guarda do segurado por conta da realiza\xe7\xe3o dos trabalhos.",null)
B.yJ=new A.aU("RC ve\xedculos terrestres motorizados","RC riscos contingentes de ve\xedculos terrestres motorizados Inclui danos materiais e/ou corporais causados sempre a terceiros por ve\xedculos de propriedade dos empregados que estejam sendo utilizados para servi\xe7os relacionados ao segurado.",null)
B.ym=new A.aU("Responsabilidade civil cruzada","Na cobertura normal da ap\xf3lice n\xe3o s\xe3o considerados terceiros os funcion\xe1rios e os bens de empreiteiros, subempreiteiros e outros. Assim, caso queira inclu\xed-los, o segurado dever\xe1 contratar a cobertura de responsabilidade civil cruzada. \n Al\xe9m desses itens, ao contratar a ap\xf3lice do RC Obras, o segurado pode optar por incluir outras coberturas adicionais, que variam bastante. Nesse sentido, elas podem abranger, por exemplo, funda\xe7\xf5es, falha de profissional da \xe1rea m\xe9dica, responsabilidade civil do empregador, polui\xe7\xe3o, despesas com conten\xe7\xe3o de sinistros etc.",null)
